import React, { useState, useEffect, Component } from "react";
import MaterialTable from "material-table";
// import Container from "@material-ui/core/Container";
import TableContainer from "@material-ui/core/TableContainer";

import { makeStyles } from "@material-ui/core/styles";
import Paper from "@material-ui/core/Paper";
import Table from "@material-ui/core/Table";
import TableBody from "@material-ui/core/TableBody";
import TableCell from "@material-ui/core/TableCell";
// import TableContainer from "@material-ui/core/TableContainer";
import TableHead from "@material-ui/core/TableHead";
import TablePagination from "@material-ui/core/TablePagination";
import TableRow from "@material-ui/core/TableRow";
import Container from "@material-ui/core/Container";
import KeyboardArrowDownIcon from "@material-ui/icons/KeyboardArrowDown";
import KeyboardArrowUpIcon from "@material-ui/icons/KeyboardArrowUp";
import IconButton from "@material-ui/core/IconButton";
import Box from "@material-ui/core/Box";
import Collapse from "@material-ui/core/Collapse";
import Typography from "@material-ui/core/Typography";
import TextField from "@material-ui/core/TextField";

// import Paper from "@material-ui/core/Paper";
import InputBase from "@material-ui/core/InputBase";
import Divider from "@material-ui/core/Divider";
// import IconButton from "@material-ui/core/IconButton";
import MenuIcon from "@material-ui/icons/Menu";
import SearchIcon from "@material-ui/icons/Search";
import DirectionsIcon from "@material-ui/icons/Directions";
import CircularProgress from "@material-ui/core/CircularProgress";

import { authAxios } from "../../utils";
import { orderListURL } from "../../constants";

const useStyles = makeStyles({
  table: {
    minWidth: 700
  }
});

function Customer() {
  const [orders, setOrders] = useState([]);
  const [loading, setLoading] = useState(false);

  const classes = useStyles();

  const columns = [
    { title: "Shop Name", field: "shop_name" },
    { title: "Total Amount", field: "total" },
    { title: "Data", field: "start_date" },
    { title: "Status", field: "order_status" }
  ];

  useEffect(() => {
    const fetchOrders = async () => {
      setLoading(true);
      const res = await authAxios.get(orderListURL);
      setOrders(res.data);
      setLoading(false);
    };

    fetchOrders();
  }, []);

  return (
    <Container>
      {loading && (
        <div
          align="middle"
          className={classes.loading}
          // style={{ position: "relative" }}
          style={{ display: "flex", justifyContent: "center" }}
        >
          <CircularProgress />
        </div>
      )}
      <MaterialTable
        options={
          ({
            headerStyle: {
              // backgroundColor: "#01579b",#bbdefb
              backgroundColor: "#9fa8da",
              color: "#212121"
            },
            rowStyle: {
              backgroundColor: "#e8eaf6"
            }
          },
          {
            pageSize: 20,
            pageSizeOptions: [20, 50, 100]
          })
        }
        title="Orders"
        columns={columns}
        data={orders}
        pageSize={10}
        detailPanel={rowData => {
          const orderItem = rowData.order_items;
          console.log(rowData);
          return (
            <div>
              <TableContainer component={Paper}>
                <Table className={classes.table} aria-label="spanning table">
                  <TableHead>
                    <TableRow>
                      <TableCell align="center" colSpan={4}>
                        Order Details
                      </TableCell>
                      {/* <TableCell align="right">Price</TableCell> */}
                    </TableRow>
                    <TableRow>
                      <TableCell>Item Name</TableCell>
                      <TableCell align="right">Item Price</TableCell>
                      <TableCell align="right">Quantity</TableCell>
                      <TableCell align="right">Total Price</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {orderItem.map(row => (
                      <TableRow key={row.desc}>
                        <TableCell>{row.item.title}</TableCell>
                        <TableCell align="right">{row.quantity}</TableCell>
                        <TableCell align="right">{row.quantity}</TableCell>
                        <TableCell align="right">{row.final_price}</TableCell>
                      </TableRow>
                    ))}

                    <TableRow>
                      <TableCell rowSpan={2} />
                      <TableCell colSpan={2}>Total</TableCell>
                      <TableCell align="right">{rowData.total}</TableCell>
                    </TableRow>
                  </TableBody>
                </Table>
              </TableContainer>
            </div>
          );
        }}
      />
    </Container>
  );
}
export default Customer;
